import React, {memo} from 'react';
import styled from 'styled-components';
import dataset from '../dataset';

const HeaderContainer = styled.div`
    margin-top: 40px;

    background-color: #f605;
    width:100%;
    height:60px;
    display: flex;
    justify-content: center;
    align-items: center;
    padding:0 40px;

    .navContainer{
      width:100%;
      background-color: #00f5;
      display: flex;
      margin:0 auto;

      .navInner{
        width:1600px;
        display: flex;
        align-items: center;

        .logoImg{
          width:100px;
          height:auto;
          margin-right:40px;
        }

        .navWrap{
          display: flex;
        }
      }
    }
`;

const Header = memo(() => {

  const {nav} = dataset.header;

  return (
    <HeaderContainer>
      <nav className='navContainer'>
        <div className='navInner'>
          <img className='logoImg' alt='logoImg' src='img/logo.png'/>
            <ul className='navWrap'>
              {nav.map((v, i) =>{
                return(
                  <li key={i}>{v.title}</li>
                )
              })}
            </ul>
        </div>
      </nav>
    </HeaderContainer>
  );
});

export default Header;
